import { Link } from 'react-router-dom';
import React, { useState } from 'react';

function SearchBar() {
  const [location, setLocation] = useState('all');
  const [priceRange, setPriceRange] = useState('all');
  const [accommodationType, setAccommodationType] = useState('all');

  const handleSearch = (e) => {
    e.preventDefault();
    console.log('Search query:', location, priceRange, accommodationType);
    // Handle search query logic here
  };
  return (
    <div>
         <div className="search-bar">
          <form onSubmit={handleSearch}>
            <div className="search-dropdowns">
              <select id="location" name="location" value={location} onChange={(e) => setLocation(e.target.value)} >
                <option value="all">All Locations</option>
                <option value="mt-Pleasent">Mt Pleasant</option>
                <option value="borrowdale">Borrowdale</option>
                <option value="avondale">Avondale</option>
              </select>
              <select id="price-range" name="price-range" value={priceRange} onChange={(e) => setPriceRange(e.target.value)} >
                <option value="all">All Price Ranges</option>
                <option value="60-100">$60 - $100</option>
                <option value="110-130">$110 - $130</option>
                <option value="150-200">$150 - $200</option>
              </select>
              <select id="accommodation-type" name="accommodation-type" value={accommodationType} onChange={(e) => setAccommodationType(e.target.value)} >
                <option value="all">All Types</option>
                <option value="room2">Room 2</option>
                <option value="room3">Room 3</option>
                <option value="above3">above 3</option>
              </select>
              <button id="search-btn" type="submit"> Search </button>
            </div>
          </form>
        </div>
        <div className="explore-listings">
          <Link to="/listings">
            <button>Explore Listings</button>
          </Link>
        </div>
    </div>
   
  )
    
  
}

export default SearchBar;
